import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { BonecosComponent } from './bonecos/bonecos.component';
import { FormsModule } from '@angular/forms';




@NgModule({
  declarations: [
    BonecosComponent
  ],
  imports: [
    CommonModule,
    FormsModule
  ]
})
export class SelecaoDeBonecoModule { }
